import React,{useState} from 'react';


interface Props{
    text: string;
}
interface 

export const TestComponent: React.FC<Props> = (props) => {
    const [count, setCount] = useState<number|null>(null);
    return <div>
        <h1>{props.text}</h1>
        <h2>{count}</h2>
    </div>;
};
